import React from "react";

import Header from "../../components/Header/Header";
import Footer from "../../components/Footer/Footer";
import ProductList from "../../components/Product/ProductList";

const Home = () => {
  return (
    <div>
      <Header />
        <div className="grid">
          <ProductList />
        </div>
      <Footer />
    </div>
  );
};

export default Home;
